import React from 'react';
import styled from 'styled-components';
import Header from '../styles/Header';

const MainDiv = styled.div`
  margin: 30px;
`;

const Title = styled.h1`
  color: ${({ theme }) => theme.headerWhite};
`;

const Index = () => {
  return (
    <MainDiv>
      <Header />
      <Title>Starhop</Title>
    </MainDiv>
  );
};

export default Index;
